import { PreventableEvent } from '@progress/kendo-angular-common';
/**
 * Arguments for the `select` event of the Drawer.
 */
export class DrawerSelectEvent extends PreventableEvent {
    /**
     * @hidden
     */
    constructor(args) {
        super();
        Object.assign(this, args);
    }
}
